var $bm_rt;
var freq, decay, delay, dur, myDelay, t, startVal, endVal, amp, w;
freq = 2;
decay = 8;
delay = 0.03;
dur = 0.14;
myDelay = $bm_mul($bm_sub(textIndex, 1), delay);
t = $bm_sub(time, $bm_sum(inPoint, myDelay));
startVal = 100;
$bm_rt = endVal = 0;
if (t < dur) {
    $bm_rt = linear(t, 0, dur, startVal, endVal);
} else {
    amp = $bm_div($bm_sub(endVal, startVal), dur);
    w = $bm_mul($bm_mul(freq, Math.PI), 2);
    $bm_rt = $bm_sum(endVal, $bm_mul(amp, $bm_div($bm_div(Math.sin($bm_mul(t, w)), Math.exp($bm_mul(decay, t))), w)));
}

